import React, { useState } from 'react';
import axios from 'axios';
import './RandomDataGenerator.css';

const RandomDataGenerator = () => {
    const [region, setRegion] = useState('');
    const [errors, setErrors] = useState(0);
    const [seed, setSeed] = useState('');
    const [page, setPage] = useState(1);
    const [data, setData] = useState([]);
    const [isLoading, setIsLoading] = useState(false);

    // Функция для загрузки данных
    const loadData = async (pageNum) => {
        try {
            setIsLoading(true);
            const response = await axios.post('http://localhost:3000/generate', {
                region,
                errors,
                seed,
                page: pageNum,
                limit: 10,
            });
            setData((prevData) => [...prevData, ...response.data]);
        } catch (error) {
            console.error('Error loading data:', error);
        } finally {
            setIsLoading(false);
        }
    };

    const generateRandomSeed = async () => {
        try {
            const response = await axios.get('http://localhost:3000/random-seed');
            setSeed(response.data.seed);
        } catch (error) {
            console.error('Error generating random seed:', error);
        }
    };

    const handleScroll = (e) => {
        const { scrollTop, scrollHeight, clientHeight } = e.target;
        if (scrollHeight - scrollTop === clientHeight && !isLoading) {
            const nextPage = page + 1;
            setPage(nextPage);
            loadData(nextPage);
        }
    };

    const handleGenerate = async () => {
        setData([]);
        setPage(1);
        loadData(1);
    };

    const exportToCSV = () => {
        const csvRows = [];
        const headers = ['#', 'UUID', 'Name', 'Address', 'Phone'];
        csvRows.push(headers.join(','));

        data.forEach((item, index) => {
            const row = [
                index + 1,
                item.uuid,
                item.name,
                item.address,
                item.phone,
            ];
            csvRows.push(row.join(','));
        });

        const csvContent = csvRows.join('\n');
        const blob = new Blob([csvContent], { type: 'text/csv' });
        const url = URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = 'generated_data.csv';
        a.click();
        URL.revokeObjectURL(url);
    };

    return (
        <div className="form-group d-flex align-items-center mb-3">
            <div className="input-group mr-2" style={{ width: '150px' }}>
                <select
                    className="form-control"
                    value={region}
                    onChange={(e) => setRegion(e.target.value)}
                >
                    <option value="">Select Language</option>
                    <option value="en">English</option>
                    <option value="de">Deutsch</option>
                    <option value="pl">Polski</option>
                </select>
            </div>

            <div className="input-group mr-2">
                <input
                    type="range"
                    className="slider"
                    min="0"
                    max="10"
                    step="0.25"
                    value={errors}
                    onChange={(e) => setErrors(e.target.value)}
                />
                <input
                    type="number"
                    className="form-control"
                    placeholder="Error Count"
                    min="0"
                    max="1000"
                    value={errors}
                    onChange={(e) => setErrors(e.target.value)}
                    inputMode="decimal"
                />
            </div>

            <div className="input-group mr-2">
                <input
                    type="text"
                    className="form-control"
                    placeholder="Seed"
                    value={seed}
                    readOnly
                />
                <button
                    className="btn btn-secondary ml-2"
                    onClick={generateRandomSeed}
                >
                    Random Seed
                </button>
            </div>

            <div className="mr-2">
                <button
                    className="btn btn-primary"
                    onClick={handleGenerate}
                >
                    Generate
                </button>
            </div>
            <div>
                <button
                    className="btn btn-secondary"
                    onClick={exportToCSV}
                >
                    Export CSV
                </button>
            </div>
        </div>
    );
};

export default RandomDataGenerator;
